import { Box } from "@mui/material";
import React from "react";

export default function AttachFilesModal() {
  return (
    <Box
      sx={{
        width: "300px",
        height: "90%",
        border: "1px solid white",
        position: "absolute",
        top: "50%",
        // left: "-50%",
      }}
    ></Box>
  );
}
